  .then(text => {
    lat = parseFloat(text.split(',')[0]);
    long = parseFloat(text.split(',')[1]);
    console.log('New Lat:', lat);
  });

ReactDOM.render(<Map
  markers={[
      { 
          position: [ parseFloat(lat) , parseFloat(long)],
          draggable: true, 
          title:"Marker title",
          onClick: e => {
              console.log("clicked ");
          },
          onDragend: e => {
              console.log("dragged");
          }
      }
  ]}
